    }

    function resetGame() private {
        gameNumber++;
        TOTAL_NGNT = 0;
    }

    function endGame() private {
        emit GameEnded(gameNumber);
        generateRandomNumber();
    }

    function setForwarder(address _forwarder) public{
        trustedForwarder = _forwarder;
    }

    receive () external payable {
    }
}

